import axios from 'axios'

// 创建 axios 实例
const service = axios.create({
  baseURL: 'http://localhost:8080',
  timeout: 5000 // 请求超时时间
})

/**
 * 获取所有充电桩信息
 * @returns {Promise} 返回充电桩信息列表
 */
export function getAllChargingPiles() {
  return service({
    url: '/api/charging-pile/all',
    method: 'get'
  })
}
